import React from 'react';
import { Container } from 'react-bootstrap';
import { CircularProgressbar, buildStyles } from 'react-circular-progressbar';
import 'react-circular-progressbar/dist/styles.css';
import './Skills.css';

const Skills = () => {
    const html = 89;
    const css = 83;


    return (
        <div className="skills-section">
            <Container>
                <h2>My Skills</h2>
                <div className="progressbar-container d-flex">
                    <div className="progressbar-sub-container">
                        <CircularProgressbar className="progressbar" styles={buildStyles({ pathColor: '#E86328', textColor: '#E86328' })} background={false} value={html} text={`${html}%`} />;
                        <h5 style={{ color: '#E86328' }} className="m-0 text-center">HTML</h5>
                    </div>
                    <div className="progressbar-sub-container">
                        <CircularProgressbar className="progressbar" styles={buildStyles({ pathColor: '#E86328', textColor: '#E86328' })} background={false} value={css} text={`${css}%`} />;
                        <h5 style={{ color: '#E86328' }} className="m-0 text-center">CSS</h5>
                    </div>
                </div>
            </Container>
        </div>
    );
};

export default Skills;
